<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <title>Document</title>

    <style>
      * {
        padding: o;
        margin: 0;
        box-sizing: border-box;
      }
      .container {
        min-height: 100vh;
        width: 100%;
        display: flex;
        align-items: center;
        justify-content: center;
      }

      .container svg {
        height: 400px;
        width: 500px;
        border: 1px solid rgb(215, 215, 215);
        border-radius: 1rem;
      }

      @keyframes tough_t {
        0% {
          transform: translate(473.25px, 437.849988px) scale(0.8, 0.8)
            translate(-204.5px, -127px);
        }
        50% {
          transform: translate(473.25px, 437.849988px) scale(0.8, 0.8)
            translate(-204.5px, -127px);
        }
        58.3333% {
          transform: translate(463.25px, 301.849994px) scale(1.2, 1.2)
            translate(-204.5px, -127px);
        }
        100% {
          transform: translate(463.25px, 301.85px) scale(1.2, 1.2)
            translate(-204.5px, -127px);
        }
      }
      @keyframes tough_v {
        0% {
          visibility: hidden;
          animation-timing-function: steps(1);
        }
        50% {
          visibility: visible;
          animation-timing-function: steps(1);
        }
        100% {
          visibility: visible;
          animation-timing-function: steps(1);
        }
      }
      @keyframes tough_o {
        0% {
          opacity: 0;
        }
        50% {
          opacity: 0;
        }
        58.3333% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }
      @keyframes try_t {
        0% {
          transform: translate(371.25px, 558.850018px) scale(0.7, 0.7)
            translate(-214.5px, -138.5px);
        }
        25% {
          transform: translate(371.25px, 558.850018px) scale(0.7, 0.7)
            translate(-214.5px, -138.5px);
        }
        33.3333% {
          transform: translate(371.25px, 402.849994px) scale(1.2, 1.2)
            translate(-214.5px, -138.5px);
        }
        100% {
          transform: translate(371.25px, 402.85px) scale(1.2, 1.2)
            translate(-214.5px, -138.5px);
        }
      }
      @keyframes try_v {
        0% {
          visibility: hidden;
          animation-timing-function: steps(1);
        }
        25% {
          visibility: visible;
          animation-timing-function: steps(1);
        }
        100% {
          visibility: visible;
          animation-timing-function: steps(1);
        }
      }
      @keyframes try_o {
        0% {
          opacity: 0;
        }
        25% {
          opacity: 0;
        }
        33.3333% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }
      @keyframes easy_t {
        0% {
          transform: translate(266.75px, 624.350024px) scale(0.7, 0.7)
            translate(-204.5px, -125px);
        }
        8.3333% {
          transform: translate(266.75px, 484.35px) scale(1.2, 1.2)
            translate(-204.5px, -125px);
        }
        100% {
          transform: translate(266.767383px, 484.379364px) scale(1.2, 1.2)
            translate(-204.5px, -125px);
        }
      }
      @keyframes easy_o {
        0% {
          opacity: 0;
        }
        8.3333% {
          opacity: 1;
        }
        100% {
          opacity: 1;
        }
      }
    </style>
